import React, { useState, useEffect } from "react";
import ProyectoForm from "./ProyectoForm";
import EditarProyectoForm from "./EditarProyectoForm";
import "./Main.css";
import { FaEdit, FaTrash, FaPlus } from 'react-icons/fa';

const Main = () => {
  const [proyectos, setProyectos] = useState([]);
  const [mostrarFormulario, setMostrarFormulario] = useState(false);
  const [proyectoEditar, setProyectoEditar] = useState(null);

  useEffect(() => {
    getAllProject();
  }, []);

  const getAllProject = async () => {
    try {
      const response = await fetch("http://localhost:3000/projects/");
      if (response.ok) {
        const data = await response.json();
        setProyectos(data);
      } else {
        console.error("Error al obtener los proyectos:", response.statusText);
      }
    } catch (error) {
      console.error("Error al comunicarse con el servidor:", error);
    }
  };

  const handleCrearProyecto = async (proyecto) => {
    try {
      const response = await fetch("http://localhost:3000/projects/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify(proyecto)
      });
      if (response.ok) {
        const proyectoCreado = await response.json();
        setProyectos([...proyectos, proyectoCreado]);
        toggleFormulario();
      } else {
        console.error("Error al guardar el proyecto:", response.statusText);
      }
    } catch (error) {
      console.error("Error al comunicarse con el servidor:", error);
    }
  };

  const toggleFormulario = () => {
    setMostrarFormulario(!mostrarFormulario);
    setProyectoEditar(null); // Reiniciar el proyecto para editar
  };

  const handleEditarProyecto = (proyecto) => {
    setProyectoEditar(proyecto);
    toggleFormulario();
  };

  const handleEliminarProyecto = async (proyectoId) => {
    try {
      const response = await fetch(`http://localhost:3000/projects/${proyectoId}`, {
        method: "DELETE"
      });
      if (response.ok) {
        const proyectosActualizados = proyectos.filter(proyecto => proyecto.id !== proyectoId);
        setProyectos(proyectosActualizados);
      } else {
        console.error("Error al eliminar el proyecto:", response.statusText);
      }
    } catch (error) {
      console.error("Error al comunicarse con el servidor:", error);
    }
  };

  return (
    <div className="main-container">
      <div className="header">
        <h2>Proyectos</h2>
        <button className="crear-proyecto-btn" onClick={() => setMostrarFormulario(true)}>
          <FaPlus />
        </button>
      </div>

      {mostrarFormulario && (
        <div className="ventana-emergente">
          <div className="contenido">
            {proyectoEditar ? (
              <EditarProyectoForm proyectoInicial={proyectoEditar} onSubmit={handleEditarProyecto} />
            ) : (
              <ProyectoForm onSubmit={handleCrearProyecto} />
            )}
          </div>
        </div>
      )}

      <ul className="proyectos-lista">
        {proyectos.map((proyecto, index) => (
          <li className="proyecto" key={index}>
            <div className="proyecto-info">
              <div><strong>Nombre:</strong> {proyecto.nameproject}</div>
              <div><strong>Descripción:</strong> {proyecto.description}</div>
              <div><strong>Fecha Inicio:</strong> {proyecto.fechaInicio}</div>
              <div><strong>Fecha Finalización:</strong> {proyecto.fechaFinalizacion}</div>
            </div>
            <div className="botones-proyecto">
              <button className="editar-btn" onClick={() => handleEditarProyecto(proyecto)}>
                <FaEdit />
              </button>
              <button className="eliminar-btn" onClick={() => handleEliminarProyecto(proyecto.id)}>
                <FaTrash />
              </button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Main;
